import React from 'react';
import './AuthStyles.css'; // Asegúrate de que los estilos están definidos en este archivo

const Scores = () => {
  const scores = [
    { username: "User1", points: 20 },
    { username: "User2", points: 15 },
    { username: "User3", points: 30 }
  ];

  return (
    <div className="scores-container">
      <img src={`${process.env.PUBLIC_URL}/clickalm.png`} alt="Clickalm Logo" className="scores-logo" />
      <h1>Puntuación</h1>
      <ul>
        {scores.map((score, index) => (
          <li key={index} className="score-item">
            <span className="username">{score.username}</span>
            <span className="points">{score.points}</span>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default Scores;
